("ul",null,a["default"].createElement("li",null,"If you are a member of a free team, you may deactivate your account. Deactivation of an account disables your access to the Phourus team associated with that account but does not delete your profile or content, which are considered part of your team’s data."),a["default"].createElement("li",null,"Whether you can delete your message content depends on your settings. In addition, a record of edits and deletions may be retained by your team, depending on the service level of your team and your team’s settings. Please see our FAQ for more detail."),a["default"].createElement("li",null,"While you cannot completely delete a profile once it is created, you can update your profile information at any time and modify your email settings. You can also change your user name from time to time."),a["default"].createElement("li",null,"When you upload a document or a file on Phourus, you can decide where to share it and with whom. You can also share documents with your entire team, or in private groups. You can also share them externally by creating a public link if you choose. Files are not subject to post retention settings but can be deleted at any time by the person who uploaded the file or by team administrators.")),a["default"].createElement("h4",null,"Choices for Team Owners and Administrators"),a["default"].createElement("ul",null,a["default"].createElement("li",null,"Administrators have the ability to manage and change most of the team settings, including post retention settings, and can modify whether or when team members can edit or delete posts. Administrators can also deactivate member accounts for their team."),a["default"].createElement("li",null,"Only a primary owner can deactivate or delete a team or organization page."),a["default"].createElement("li",null,"For more about these privileges, choices, and permissions, see our FAQ.")),a["default"].createElement("h4",null,"Other Choices"),a["default"].createElement("ul",null,a["default"].createElement("li",null,"The browser you use may provide you with the ability to control cookies or other types of local data storage."),a["default"].createElement("li",null,"Your mobile device may provide you with choices around how and whether location or other data is shared with us.")),a["default"].createElement("h4",null,"Sharing and Disclosure"),a["default"].createElement("p",null,"There are times when communications and related content and other user information may be shared by Phourus. This section discusses only how Phourus may share user information. Organizations that use Phourus may have their own policies for sharing and disclosure of information they can access through Phourus. Phourus may share information:"),a["default"].createElement("ul",null,a["default"].createElement("li",null,a["default"].createElement("strong",null,"With consent, to comply with legal process, or to protect Phourus and our users.")," When we have your consent or if we believe that disclosure is reasonably necessary to comply with a law, regulation or legal request; to protect the safety, rights, or property of the public, any person, or Phourus; or to detect, prevent, or otherwise address fraud, security or technical issues. If we receive a law enforcement or other third party request for information we will provide prior notice to the subject of the request where we are legally permitted to do so. For more information on Phourus’ policies for responding to requests for user data, please see our User Data Request Policy."),a["default"].createElement("li",null,a["default"].createElement("strong",null,"With third parties and agents.")," We may employ third party companies or individuals to process personal information on our behalf based on our instructions and in compliance with this Privacy Policy. For example, we may share data with a security consultant to help us get better at preventing unauthorized access or with an email vendor to send messages on our behalf. We may also share data with hosting providers, payment processors, marketing vendors, and other consultants who work on our behalf and under contractual promises of confidentiality."),a["default"].createElement("li",null,a["default"].createElement("strong",null,"About you with your organization or team administrator(s)."),a["default"].createElement("ul",null,a["default"].createElement("li",null,"We may share your email address and team name with your organization. If the email address under which you've registered your account belongs to or is controlled by an organization (to be clear, we’re not talking about free web-based email providers like Gmail, Hotmail or Yahoo! Mail) we may disclose that email address and associated team names to that organization in order to help it understand who associated with that organization uses Phourus, and to assist the organization with its enterprise accounts. Please do not use a work email address for our services unless you are authorized to do so, and are therefore comfortable with this kind of sharing."),a["default"].createElement("li",null,"In addition, there may be times when you contact Phourus to help resolve an issue specific to a team you are a member of. In order to help resolve the issue, we may need to share your concern with your administrator. When possible, we will try to mask or remove any identifying information before sharing these communications."))),a["default"].createElement("li",null,a["default"].createElement("strong",null,"In the event of a merger or sale.")," If we engage in a merger, acquisition, bankruptcy, dissolution, reorganization, or similar transaction or proceeding that involves the transfer of the information described in this Privacy Policy."),a["default"].createElement("li",null,a["default"].createElement("strong",null,"That is aggregated and non-identifiable.")," We may also share aggregated or non-personally identifiable information with our partners or others for business or research purposes. For example, we may tell a prospective Phourus customer the average number of posts made within a Phourus team in a day or may partner with research firm or academics to explore interesting questions about workplace communications. Again, this policy is not intended to prohibit the disclosure and use of aggregated or de-identified data.")),a["default"].createElement("h4",null,"Security"),a["default"].createElement("p",null,"Phourus takes reasonable steps to protect information you provide to us as part of your use of the Phourus service from loss, misuse, and unauthorized access or disclosure. When you enter sensitive information (such as sign-in credentials) we encrypt the transmission of that information using secure socket layer technology (SSL). We follow generally accepted standards to protect the personal data submitted to us, both during transmission and once we receive it. However, no electronic or email transmission or digital storage mechanism is ever fully secure or error free."),a["default"].createElement("p",null,"To learn more about current practices and policies regarding security and confidentiality, please see our Security Practices; we keep that document updated as these practices evolve over time."),a["default"].createElement("h4",null,"Children’s information"),a["default"].createElement("p",null,"Phourus is not directed to children under 13. If you learn that a minor child has provided us with personal information without your consent, please contact us."),a["default"].createElement("h4",null,"Changes to this Privacy Policy"),a["default"].createElement("p",null,"We may change this policy from time to time, and if we do we’ll post any changes on this page. If you continue to use Phourus after those changes are in effect, you agree to the revised policy. If the changes are material, we may provide more prominent notice or seek your consent to the new policy."),a["default"].createElement("h4",null,"Contacting Phourus"),a["default"].creat